"use strict";describe("PhoneCat controllers",function(){beforeEach(function(){this.addMatchers({toEqualData:function(a){return angular.equals(this.actual,a)}})});beforeEach(module("phonecatApp"));beforeEach(module("phonecatServices"));describe("PhoneListCtrl",function(){var a,b,c;beforeEach(inject(function(f,e,d){c=f;c.expectGET("phones/phones.json").respond([{name:"Nexus S"},{name:"Motorola DROID"}]);a=e.$new();b=d("PhoneListCtrl",{$scope:a})}));it('should create "phones" model with 2 phones fetched from xhr',function(){expect(a.phones).toEqualData([]);c.flush();expect(a.phones).toEqualData([{name:"Nexus S"},{name:"Motorola DROID"}])});it("should set the default value of orderProp model",function(){expect(a.orderProp).toBe("age")})});describe("PhoneDetailCtrl",function(){var b,d,c,a=function(){return{name:"phone xyz",images:["image/url1.png","image/url2.png"]}};beforeEach(inject(function(h,f,g,e){d=h;d.expectGET("phones/xyz.json").respond(a());g.phoneId="xyz";b=f.$new();c=e("PhoneDetailCtrl",{$scope:b})}));it("should fetch phone detail",function(){expect(b.phone).toEqualData({});d.flush();expect(b.phone).toEqualData(a())})})});